<!DOCTYPE html>
<html lang="en">
<head>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta charset="utf-8">
    <meta http-equiv='cache-control' content='no-cache'>
    <meta http-equiv='expires' content='0'>
    <meta http-equiv='pragma' content='no-cache'>
    <title>Ð¡reate Grid</title>
<style>
    h1 {
        font-family: helvetica, arial, sans-serif;
        text-align: center;
        border: 0;
        margin: 0;
    }

    body {
        width: 95vw;
        /*    margin: 0 auto;
*/ background-color: rgb(255, 212, 183);
        padding: 0 20px 20px 20px;
        /*border: 5px solid black;*/
    }

    .full-img img {
        display: inline-block;
        position: absolute;
        top: 0;
        left: 35%;
        max-height: 100%;
    }

    .templates {
        display: inline-block;
        position: absolute;
        top: 0;
        left: 70%;
        /*    max-height: 100%;
*/ width: 50%;
        height: 90vh;
        border: 0;
    }

    button {
        /*  border: 0;
  background: rgb(194, 105, 105);
  text-shadow: 1px 1px 1px white;
  border: 1px solid #999;*/
        position: absolute;
        cursor: pointer;
        top: 5px;
        left: 5px;
    }

    progress {
        position: absolute;
        top: 35px;
        left: 5px;
    }

    .preview {
        position: absolute;
        top: 60px;
        width: 20%;
        height: 90vh;
        overflow-y: auto;
        scrollbar-width: thin;
        scrollbar-color: rgb(194, 105, 105) orange;
        /*min-width : 150px;*/
    }

    .thumb-bar img {
        display: inline;
        width: 30%;
        float: left;
        cursor: pointer;
        border: 1px solid rgb(95, 55, 55);
    }

    .close {
        /*display: inline;*/
        margin: 1% -30%;
        /* position:absolute;*/
        cursor: no-drop;
        float: left;
        /*    top: 2%;
    left: 2%;
*/
        /*font-weight: bold;*/
        background: rgba(150,150,150,0.6);
        text-shadow: 1px 1px 1px white;
        border: 1px solid #999;
        z-index: 1;
    }

    .thumb {
        display: block;
        margin: 0 0;
        /*cursor: no-drop;*/
        z-index: -1;
    }
</style>
</head>
<body>
    <link id="templates" rel="preload" crossorigin="anonymous" as="fetch" type="text/plain" href="https://georgebig2.github.io/draw-data/template.txt?version=1.0">
    <progress class="progress" max="1" min="0" value="0"></progress>
    <div class="preview">
        <div class="thumb-bar"></div>
        <p id="status">loading...</p>
    </div>
    <div class="full-img">
        <!--<iframe class="templates" src="https://drive.google.com/embeddedfolderview?id=1ZtdmwAPS5olTNovk5Z99dBiTJLCRC4wS#grid"></iframe>-->
        <img id="imageSrc" alt="" />
        <input type="file" id="fileInput" accept="image/*" style="display:none" />
        <button id="fileButton" type="button">Open image</button>
    </div>

    <script type="text/javascript">

        const imageSrc = document.getElementById('imageSrc');
        const fileButton = document.getElementById("fileButton");
        const progress = document.querySelector("progress");
        var fileInput = document.getElementById("fileInput");

        const templates = document.getElementById('templates');
        var templatesText;
        async function getData() {
            const response = await fetch(templates.href);
            templatesText = await response.text();
            console.log(templatesText);
        }
        getData();

        const emptyFile = fileInput.files;
        fileButton.addEventListener(
            "click",
            (e) => {
                fileInput.files = emptyFile;
                fileInput.click();
            },
            false
        );
        fileInput.addEventListener('input', (e) => {

            var trigger = function (contents) {
                gen_grid = function (library, numTry, RegMinPixels) {
                    const image = new Image();
                    image.onload = function () {
                        let imageData = loadImage(image);
                        if (imageData.width > 0) {
                            var src = texFromImageData(imageData);

                            const batch = 9;
                            progress.hidden = false;
                            progress.value = 0;
                            //for (var i = 0; i < batch; i++)
                            {
                                var func = function (p) {
                                    let dst = Module.generate_grid(src, library, numTry, RegMinPixels);
                                    var imgData = new ImageData(new Uint8ClampedArray(dst.data), dst.width, dst.height);
                                    add_grid_image(imgData);
                                    dst.delete();

                                    progress.value += 1 / batch;// (p + 1) / 6;
                                    progress.hidden = (progress.value >= 1);
                                    console.log('generate_grid ' + p);

                                    if (p > 0) {
                                        setTimeout(func, 0, p - 1);
                                    }
                                    else {
                                        progress.hidden = true;
                                        src.delete();
                                        library.delete();
                                    }
                                };
                                setTimeout(func, 0, batch - 1);
                            }
                        }
                    };
                    image.src = contents;
                };
                load_templates(gen_grid);
            };

            var reader = new FileReader();
            reader.onload = function (e) {
                imageSrc.src = e.target.result;
                trigger(e.target.result);
            };
            reader.readAsDataURL(e.target.files[0]);
        }, false);

        function handleImageClick({ target }) {
            imageSrc.setAttribute('src', target.getAttribute('src'));
        }
        function handleCloseClick({ target }) {
            const thumbBar = document.querySelector('.thumb-bar');
            thumbBar.removeChild(target.parentElement);
        }

        function texFromImageData(imageData) {
            var mat = new Module.JTex(imageData.height, imageData.width);
            mat.data.set(imageData.data);
            return mat;
        };

        function loadImage(imageSource) {
            var img = null;
            if (typeof imageSource === 'string') {
                img = document.getElementById(imageSource);
            } else {
                img = imageSource;
            }
            var canvas = null;
            var ctx = null;
            if (img instanceof HTMLImageElement) {
                canvas = document.createElement('canvas');
                canvas.width = img.width;
                canvas.height = img.height;
                ctx = canvas.getContext('2d', { willReadFrequently: true });
                ctx.drawImage(img, 0, 0, img.width, img.height);
                //document.getElementById('status').innerHTML = img.width;
            } else if (img instanceof HTMLCanvasElement || img instanceof OffscreenCanvas) {
                canvas = img;
                ctx = canvas.getContext('2d');
            } else {
                throw new Error('Please input the valid canvas or img id.');
                return;
            }

            var imgData = ctx.getImageData(0, 0, canvas.width, canvas.height);
            return imgData;// matFromImageData(imgData);
        };

        function add_grid_image(imagedata) {
            var canvas = document.createElement('canvas');
            var ctx = canvas.getContext('2d');
            canvas.width = imagedata.width;
            canvas.height = imagedata.height;
            ctx.putImageData(imagedata, 0, 0);

            var image = new Image();
            image.src = canvas.toDataURL();
            image.addEventListener('click', handleImageClick);
            //const thumb = document.createElement("div");
            //thumb.classList.add('thumb');
            //thumb.appendChild(image);

            const button = document.createElement("div");
            button.classList.add('close');
            let text = document.createTextNode('x');
            button.appendChild(text);
            button.addEventListener('click', handleCloseClick);

            const box = document.createElement("div");
            box.appendChild(image);
            box.appendChild(button);

            const thumbBar = document.querySelector('.thumb-bar');
            thumbBar.appendChild(box);
        }

        function load_templates(on_finish) {
            //var xmlhttp = new XMLHttpRequest();
            //xmlhttp.onreadystatechange = function () {
            //if (xmlhttp.status == 200 && xmlhttp.readyState == 4) {
            const text = templatesText;// xmlhttp.responseText;
            //console.log(text);
            const rows = text.split('\n');
            const path = rows[0];
            const numTry = rows[1];
            const RegMinPixels = rows[2];

            (async () => {
                var library = new Module.TemplateLibrary();
                for (var i = 3; i < rows.length; i++) {
                    const cols = rows[i].split(' ');
                    let img = new Image();
                    progress.value = i / rows.length;
                    progress.hidden = (i == rows.length - 1);

                    try {
                        img.src = path + cols[0] + '.png';
                        img.crossOrigin = "Anonymous";
                        await img.decode();
                        let imageData = loadImage(img);
                        if (imageData.width > 0) {
                            var src = texFromImageData(imageData);
                            console.log('add_template ' + cols[0] + ' ' + cols[1]);
                            Module.add_template(src, library, parseInt(cols[1]));
                            src.delete();
                        }
                    }
                    catch (e) {
                        console.log(e);
                    }
                }
                on_finish(library, numTry, RegMinPixels);
            })();
            //document.getElementById('status').innerHTML = rows[1];
            //}
            //};
            //xmlhttp.open("GET", "template.txt", true);
            //xmlhttp.send();
        }

        var Module = {
            onRuntimeInitialized() {
                document.getElementById('status').innerHTML = '';
            }
        };
    </script>
